void toAY(unsigned char regnum, unsigned char data){
        PORTA=regnum; 
        PORTC|=0x18;  
        #asm("nop");
        #asm("nop");
        #asm("nop");
        #asm("nop");
        #asm("nop");
        #asm("nop");
        #asm("nop");
        #asm("nop");
        PORTC&=~0x18;
        #asm("nop");
        #asm("nop");
        
        PORTA=data;
        PORTC|=0x08;
        #asm("nop");
        #asm("nop");
        #asm("nop");
        #asm("nop");
        #asm("nop");
        #asm("nop");
        #asm("nop");
        #asm("nop");
        PORTC&=~0x08;
        #asm("nop");
        #asm("nop");
}

